# Python Question: Word Ladder
'''
Given two words, `beginWord` and `endWord`, and a dictionary `wordList`, find the length of the shortest transformation sequence from `beginWord` to `endWord`, such that:

1. Only one letter can be changed at a time.
2. Each transformed word must exist in the `wordList`.

Return 0 if no such transformation sequence exists.

Note:
- All words have the same length.
- All words contain only lowercase alphabetic characters.
- `wordList` does not contain any duplicate words.
- `beginWord` and `endWord` are non-empty and are not the same.

Example:
Input: beginWord = "hit", endWord = "cog", wordList = ["hot","dot","dog","lot","log","cog"]
Output: 5
Explanation: As one shortest transformation is "hit" -> "hot" -> "dot" -> "dog" -> "cog",
return its length 5.

Input: beginWord = "hit", endWord = "cog", wordList = ["hot","dot","dog","lot","log"]
Output: 0
Explanation: The endWord "cog" is not in wordList, therefore no possible transformation.
'''

# Solution
def solution():
    def word_ladder(beginWord, endWord, wordList):
        """
        Finds the length of the shortest transformation sequence from beginWord to endWord.

        Args:
            beginWord: The starting word.
            endWord: The ending word.
            wordList: A list of valid words.

        Returns:
            The length of the shortest transformation sequence, or 0 if no such sequence exists.
        """
        if endWord not in wordList:
            return 0

        wordSet = set(wordList)  # Convert wordList to a set for faster lookups
        queue = [(beginWord, 1)]  # Initialize the queue with the beginWord and its initial level (1)
        visited = {beginWord}  # Keep track of visited words to avoid cycles

        while queue:
            word, level = queue.pop(0)  # Dequeue the next word and its level

            if word == endWord:
                return level  # Found the endWord, return the current level

            for i in range(len(word)):  # Iterate through each character in the word
                for char_code in range(ord('a'), ord('z') + 1):  # Try all possible characters for the current position
                    new_char = chr(char_code)
                    new_word = word[:i] + new_char + word[i+1:]  # Create a new word by replacing the character at index i

                    if new_word in wordSet and new_word not in visited:  # If the new word is in the wordList and hasn't been visited
                        queue.append((new_word, level + 1))  # Enqueue the new word with the next level
                        visited.add(new_word)  # Mark the new word as visited

        return 0  # No transformation sequence found

    return word_ladder

